import React from 'react';

import { Link } from 'react-router-dom';
import classes from "./MediumRespaldo.module.css"

function MediumRespaldo() {
    return (
        <div className={classes.MediumRespaldo}>
            <h1>Respaldos</h1>
            <div className={classes.container}>
               <Link to="/respaldo-options/respaldo-ejemplos"><p>Nuestros Modelos</p></Link>
            <Link to="/respaldo-options/respaldo-builder"><p>Personalizalo</p></Link> 
            </div>
            
        </div>
    )
}

export default MediumRespaldo;
